import React from 'react';
import Link from 'next/link';
import AppLayout from '../components/AppLayout';

const Home =()=>{
    return(
        <>
        <AppLayout>
            <Link href="/about"><a>move about page</a></Link>
            <div>Hi next</div>
        </AppLayout>
        
        </>
    )
}

export default Home;
